import axios from "axios";
import React, { useEffect } from "react";

export const handleLogOut = async () => {
  useEffect(() => {
    axios.delete("/auth/logout").then(() => {
      window.location.href = "/";
    });
  });
};

export const getUser = async () => {
  useEffect(() => {
    axios.get("/auth/verify").then((res) => {
      return res.data;
    });
  }, []);
};
